import Header from "./components/03-organisms/AnalystCircle/AnalystCircle";
import ExpenseItemsList from "./components/03-organisms/Header/Header";
import AnalistCircle from "./components/03-organisms/BudgetMenager/BudgetMenager";
import BudgetMenager from "./components/03-organisms/ExpenseItemsList/ExpenseItemsList";

function App() {
  return (
    <div className="container">
      <Header></Header>
      <div className="left-column">
        <ExpenseItemsList></ExpenseItemsList>
      </div>
      <div className="right-column">
        <AnalistCircle></AnalistCircle>
        <BudgetMenager></BudgetMenager>
      </div>
    </div>
  );
}

export default App;
